import React from 'react';
import { Route, Switch } from "react-router-dom";
import { BrowserRouter } from "react-router-dom";

import Index from '../pages/index'

const Mainroute = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/' component={Index} />
            </Switch>
        </BrowserRouter>
    )
}

export default Mainroute;
